INSERT INTO `attachment_field_tb` (`attachment_field_id`, `scholar_type_id`, `attachment_desc`) VALUES
(1, 1, 'Application forms for admission to the Graduate School of the universities where the applicant may pursue graduate studies under SEARCA scholarship'),
(2, 1, 'Official transcript of academic records of each degree completed (BS transcript for MS applicants and BS and MS transcripts for PhD applicants)'),
(3, 1, 'Certification of employment'),
(4, 1, 'Brief description of the research the applicant plans to conduct for thesis/dissertation. The research topic must be in line with the thrusts of SEARCA''s Tenth Five-Year Plan i.e., social equity, environmental integrity and regional economic integration by promoting food and nutrition security; value chains and agribusiness commodity systems; innovations and modern technologies; rural entrepreneurship; climate change adaptation and resiliency, natural resource management; sub-regional cooperation in trade and investments; and government policies/reforms that address rural poverty, inequitable growth, and environmental degradation'),
(5, 1, 'Passport-size pictures'),
(6, 1, 'Curriculum vitae'),
(7, 1, 'Certification from a medical doctor that the applicant is in good physical and mental health condition and is fit to undertake graduate studies'),
(8, 1, 'Official endorsement from the employer'),
(9, 1, 'Results of Test of English as a Foreign Language (TOEFL): score of 550 for paper-based and 213 for computer-based) or IELTS results (6.0). The TOEFL results must be issued by Princeton, New Jersey, USA'),
(10, 7, 'Letter of application for the research scholarship which should be addressed to the SEARCA Director'),
(11, 7, 'Recommendation letter from the Dean of Graduate School of the university where the applicant is pursuing the degree program'),
(12, 7, 'Dissertation research outline/proposal approved by the Advisory Committee and Dean of Graduate School'),
(13, 7, 'Budgetary requirement for the entire research duly attested and recommended by the major adviser and Dean of Graduate School'),
(14, 7, 'True copy of grades for courses taken, certified by the Graduate School'),
(15, 7, 'Letter from the applicant certifying that he/she is not receiving any other research grant from any other institution. If partial funding has been obtained from the other sources, applicant must submit a certification from the funding agency indicating the grant amount and items covered by the grant'),
(16, 7, 'Research timetable indicating the activities involved in the research, and the expected date of defense'),
(17, 3, 'Original transcript of academic records for the BS and MS degrees bearing the seal of the University and fresh signatures of the Registrar or Head of the University'),
(18, 3, 'Certification of employment'),
(19, 3, 'A recommendation letter from employer'),
(20, 3, 'Updated curriculum vitae'),
(21, 3, 'Brief description of the research the applicant plans to conduct for dissertation'),
(22, 3, 'Passport-size photo of the applicant'),
(23, 3, 'Certification from a medical doctor that the applicant is in good physical and mental health condition and is fit to undertake graduate studies'),
(24, 3, 'Proofs of at least three peer-reviewed scientific papers published in scholarly journals in the applicant''s country or abroad; the applicant must have served as first author of one of these papers'),
(25, 6, 'Official transcript of academic records of each degree completed (BS transcript for MS applicants and BS and MS transcripts for PhD applicants)'),
(26, 6, 'Certification of employment'),
(27, 6, 'Brief description of the research the applicant plans to conduct for thesis/dissertation. The research topic must contribute to the growing body of knowledge on livestock research and biotechnology for the Philippine Carabao Center'),
(28, 6, 'Passport-size pictures of the applicant'),
(29, 6, 'Curriculum vitae'),
(30, 6, 'Certification from a medical doctor that the applicant is in good physical and mental health condition and is fit to undertake graduate studies'),
(31, 6, 'Admission notice from selected university'),
(32, 8, 'Curriculum Vitae'),
(33, 8, 'Endorsement Letter'),
(34, 8, 'Brief Summary of Proposed Lecture'),
(35, 7, 'Education and Work Experience (Please attach information on university education, languages, principal publications, employment record for past 5 years, scholarships/fellowships received for overseas study)'),
(36, 7, 'Work Proposal for Internship (Please attach research proposal, including research outcomes, reasons for coming to SEARCA, potential contributions to SEARCA''s research activities, period of internship sought for, a research timetable, and relevance/links to SEARCA''s ongoing projects)'),
(37, 2, 'Notice of Admission from desired study post/university'),
(38, 2, 'Official transcript of academic records of the Bachelor''s degree completed'),
(39, 2, 'Certification of employment (if employed)'),
(40, 2, 'Medical certificate'),
(41, 2, 'Certification of English proficiency test results'),
(42, 2, 'Motivation letter'),
(43, 2, 'Study plan'),
(44, 2, 'Proposed Thesis Research Outline'),
(45, 2, 'Recommendation letter');
