INSERT INTO `scholarship_type_tb` (`scholar_type_id`, `cat_id`, `scholar_desc`, `about`, `scholar_image`, `scholarship_status`, `is_project_scholarship`) VALUES
(1, 1, 'Full Master''s and PhD Scholarship', 'SEARCA''s Graduate Study Program was initiated in School Year 1968/1969. Over four decades, the scope of the Graduate Study Program has expanded to include institutional development, networking, and services to enhance graduate education in the region. SEARCA has also been providing services for administration of scholarship funds under the sponsorship of institutions other than SEAMEO.', 'searcalogo.png', 1, 0),
(2, 0, 'IDRC-SEARCA Scholarships', 'The IDRC Uplands Fellowship Project aims to establish a critical mass of high-quality human resources who could serve as catalysts for developing sustainable agriculture programs for upland communities that are generally vulnerable to food insecurity. The program''s general objective is to strengthen knowledge and research skills of professionals in agriculture and food security in the uplands of Southeast Asia who could serve as catalysts for developing sustainable agriculture programs for upland communities that are generally vulnerable to food insecurity.', 'idrc.png', 0, 1),
(3, 2, 'SEARCA-TUA (Tokyo University of Agriculture) Scholarship', 'This is a collaborative project of Tokyo University of Agriculture (Tokyo NODAI) and SEARCA. The Dissertation Doctorate Program for Agriculture and Natural Resources aims to contribute to the enhancement of agricultural research and development in Southeast Asia through the provision of a Tokyo NODAI-SEARCA scholarship for eligible candidates to be able to complete a doctorate dissertation.', 'tua.gif', 1, 0),
(4, 2, 'UPM-SEARCA (University Putra Malaysia) Scholarship', 'SEARCA through financial support of the Canada''s International Development Research Center (IDRC) is inviting qualified candidates from Cambodia, Lao PDR, and Vietnam to pursue science-based master''s degrees in the fields of related to agriculture and food security in the uplands in leading universities in the Philippines and Thailand.', 'upm.png', 0, 1),
(5, 2, 'DAAD-SEARCA Scholarship', 'DAAD''s partnership with SEARCA started in school year 1975-1976 by providing support for the Center''s graduate scholarship leading to Masters and PhD degrees in agriculture. The first 15 beneficiaries of the DAAD support were graduate students from Cambodia, Indonesia, the Philippines, Thailand, and Vietnam. Ten scholarship recipients were pursuing their Master?s degree, while five their PhD. To date, the DAAD scholarship has been awarded to 18 Cambodians, 76 Indonesians, 8 Laotians, 7 Malaysians, 22 Myanmar nationals, 82 Filipinos, 81 Thais, 25 Timorese, and 36 Vietnamese, or a total of 355 Southeast Asians (179 MS, 170 PhD, 6 Academic bridging program). As of 30 June 2014, 328 of these scholars have graduated and become DAAD-SEARCA alumni. Of these alumni, at least 23 occupy top-level positions in their home countries.', 'daad.jpg', 0, 1),
(6, 1, 'PCC-SEARCA (Philippine Carabao Center) Scholarship', 'The project aims to strengthen the Philippine Carabao Center''s pool of professionals by providing scholarship grants to qualified PCC officers and regular staff to complete graduate degrees from selected universities of center of excellence in the Philippines, USA, Canada and Australia', 'pcc.png', 1, 1),
(7, 0, 'PhD Research Scholarship', 'In November 2005, SEARCA established the PhD Research Scholarship, which provides financial support to qualified PhD students whose researches are relevant to the priority thrusts of SEARCA. The PhD research scholarship aims to: Provide PhD students the opportunity to use the resources and facilities available at SEARCA and its network of universities for their research; Produce quality research papers for publication; and Enable them to work with SEARCA''s R&D personnel on mutually identified areas of concerns/interests in agriculture and rural development.', 'searcalogo.png', 1, 0),
(8, 0, 'SEARCA Regional Professorial Chair Grants', '', 'searcalogo.png', 1, 0),
